var input = `



`

var test = `ULL
RRDDD
LURDL
UUUUD`

var steps = input.split("\n");

var instructions = steps.map(function(step){
    return step.split("");
})

var keys = [
    [0,0,1,0,0],
    [0,2,3,4,0],
    [5,6,7,8,9],
    [0,"A","B","C",0],
    [0,0,"D",0,0]
];

var keyRow = 2;
var keyColumn = 0;
var combination = [];

function findKey(instruction){
    console.log("Start @ " + keys[keyRow][keyColumn]);
    for(var i = 0; i < instruction.length; i++){
        var inst = instruction[i];
        switch (inst) {
            case "U":
                if(keyRow - 1 >= 0 && keys[keyRow-1][keyColumn] != 0){
                    keyRow -= 1;
                }
                break;
            case "R":
                if(keyColumn + 1 <= 4 && keys[keyRow][keyColumn+1] != 0){
                    keyColumn += 1;
                }
                break;
            case "D":
                if(keyRow + 1 <= 4 && keys[keyRow+1][keyColumn] != 0){
                    keyRow += 1;
                }
                break;
            case "L":
                if(keyColumn - 1 >= 0 && keys[keyRow][keyColumn-1] != 0){
                    keyColumn -= 1;
                }
                break;
        }
        var key = keys[keyRow][keyColumn];
        var index = "[" + keyRow + "][" + keyColumn + "]";
        console.log(inst + " " + index + " " + key);
    }
    combination.push(key);
}

instructions.map(findKey);

console.log(combination);
